      <p class="text-gray-600">Url</p>
      <textarea class="h-32 w-full rounded-md border bg-white px-2 py-2 outline-none ring-blue-600 focus:ring-1" type="text" placeholder="For multiple URL queries, put comma(,) between urls."></textarea>
    </label>
    <button class="mt-4 rounded-full bg-blue-800 px-10 py-2 font-semibold text-white">Submit</button>
  </div>

    )
}
